import React from "react";

const Login = () => {
  return (
    <div>
       <h1>Login</h1>
      <form>
        <input
          required
          type="text"
          placeholder="username"
          name="username"
         
        />
        <input
          required
          type="password"
          placeholder="password"
          name="password"
          
        />
        <button onClick={handleSubmit}>Login</button>
        {err && <p>{err}</p>}
        <span>
          Don't you have an account? <Link to="/register">Register</Link>
        </span>
      </form>
    </div>
  );
};

export default Login;
